import { NextRequest, NextResponse } from "next/server";

export async function GET(
  _: NextRequest,
  { params }: { params: Promise<{ color: string }> },
) {
  const { color } = await params;
  if (!color) {
    return NextResponse.json(
      { error: "color parameter is required" },
      { status: 400 },
    );
  }

  const svgData = `
  <svg width="48" height="48" viewBox="0 0 48 48" fill="none" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
    <rect width="48" height="47.0448" rx="23.5224" fill="#${color}"/>
    <rect width="48" height="47" fill="url(#pattern0_1966_47)"/>
    <defs>
    <pattern id="pattern0_1966_47" patternContentUnits="objectBoundingBox" width="1" height="1">
    <use xlink:href="#ZXRLUG80UTJNRw==" transform="matrix(0.001 0 0 0.00102128 0 -0.00093617)"/>
    </pattern>
    <image id="ZXRLUG80UTJNRw==" width="1000" height="981" preserveAspectRatio="none" xlink:href="data:image/png;base64,"/>
    </defs>
  </svg>
`;

  const svgBase64 = btoa(svgData);
  const faviconURL = `data:image/svg+xml;base64,${svgBase64}`;

  return NextResponse.json({ data: faviconURL });
}
